CREATE TABLE `abono_semanal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `abono` varchar(30) CHARACTER SET utf16 NOT NULL,
  `importe` decimal(7,0) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `abono_2` (`abono`),
  KEY `abono` (`abono`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=latin1;






CREATE TABLE `abono_viaje` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `abono` varchar(30) NOT NULL,
  `importe` int(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `caja_final` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `movil` varchar(5) NOT NULL COMMENT 'si es = 0 mov de caj\r\na',
  `fecha` datetime NOT NULL COMMENT 'fecha del movimiento',
  `dep_ft` decimal(12,2) DEFAULT NULL,
  `dep_mp` decimal(9,2) DEFAULT NULL,
  `cant_viajes_esta_sem` int(4) DEFAULT NULL COMMENT 'cant de viajes realizados esta semana\r\n',
  `can_viajes_no_pagados` int(4) DEFAULT NULL COMMENT 'cant de viajes no pagados anteriormente',
  `viajes_cobrados` int(4) DEFAULT NULL COMMENT 'cant de viajes que se cobran esta semana\r\n',
  `dep_voucher` decimal(9,2) NOT NULL COMMENT 'total de plata depositada en voucher',
  `saldo_voucher` decimal(9,2) NOT NULL,
  `diez` decimal(9,2) NOT NULL,
  `noventa` decimal(10,2) NOT NULL,
  `depositarle` decimal(9,2) DEFAULT NULL,
  `deuda_ant` decimal(9,2) DEFAULT NULL,
  `paga_a_cuenta` decimal(9,2) DEFAULT NULL COMMENT 'plata que sobro del pago, pagó de mas',
  `debe_ft` decimal(9,2) DEFAULT NULL COMMENT 'mov de caja',
  `haber_ft` decimal(9,2) DEFAULT NULL COMMENT 'mov de caja',
  `saldo_ft` decimal(9,2) NOT NULL COMMENT 'mov de caja',
  `debe_mp` decimal(9,2) NOT NULL COMMENT 'mov de caja',
  `haber_mp` decimal(9,2) NOT NULL COMMENT 'mov de caja',
  `saldo_mp` decimal(9,2) NOT NULL,
  `retiro_ft` decimal(9,2) NOT NULL,
  `retiro_mp` decimal(9,2) NOT NULL,
  `ft_actual_de_caja` decimal(9,2) NOT NULL,
  `semanas_ant` int(4) NOT NULL,
  `observaciones` varchar(100) DEFAULT NULL,
  `usuario` varchar(30) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `completa` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `movil` int(11) NOT NULL,
  `estado_admin` varchar(4) NOT NULL COMMENT 'es para deudor ',
  `nombre_titu` varchar(25) NOT NULL,
  `apellido_titu` varchar(25) NOT NULL,
  `dni_titu` varchar(13) NOT NULL,
  `direccion_titu` varchar(50) NOT NULL,
  `cp_titu` int(4) NOT NULL,
  `cel_titu` int(8) NOT NULL,
  `licencia_titu` int(8) NOT NULL,
  `nombre_chof_1` varchar(25) NOT NULL,
  `apellido_chof_1` varchar(25) NOT NULL,
  `dni_chof_1` int(9) NOT NULL,
  `direccion_chof_1` varchar(50) NOT NULL,
  `cp_chof_1` int(4) NOT NULL,
  `cel_chof_1` int(8) NOT NULL,
  `nombre_chof_2` varchar(25) NOT NULL,
  `apellido_chof_2` varchar(25) NOT NULL,
  `dni_chof_2` int(8) NOT NULL,
  `direccion_chof_2` varchar(50) NOT NULL,
  `cp_chof_2` int(4) NOT NULL,
  `cel_chof_2` int(8) NOT NULL,
  `marca` varchar(25) NOT NULL,
  `modelo` varchar(25) NOT NULL,
  `dominio` varchar(7) NOT NULL,
  `año` int(4) NOT NULL,
  `x_semana` int(4) DEFAULT NULL,
  `x_viaje` int(4) NOT NULL,
  `deuda_anterior` decimal(12,2) NOT NULL,
  `saldo_a_favor_ft` decimal(12,2) NOT NULL COMMENT 'era pago_ant',
  `saldo_a_favor_mp` decimal(12,2) NOT NULL,
  `fe_pago` date NOT NULL,
  `fecha_inicio` date DEFAULT NULL,
  `fecha_facturacion` date NOT NULL,
  `obs` text NOT NULL,
  `tropa` int(4) NOT NULL,
  `venta_1` int(4) NOT NULL,
  `venta_2` int(4) NOT NULL,
  `venta_3` int(4) NOT NULL,
  `venta_4` int(4) NOT NULL,
  `venta_5` int(4) NOT NULL,
  `v_sem_siguiente` int(2) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `movil` (`movil`)
) ENGINE=InnoDB AUTO_INCREMENT=534 DEFAULT CHARSET=utf8mb4;


