CREATE TABLE `depositos_a_moviles` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `movil` int(4) NOT NULL,
  `fecha` date NOT NULL,
  `importe` decimal(12,2) NOT NULL,
  `est` tinyint(1) NOT NULL COMMENT 'si es 0 no se le deposito si es uno esta depositado\r\n',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `estados_unidades` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(20) NOT NULL,
  `color` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `historial_de_pago` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `movil` int(11) NOT NULL,
  `fecha` date NOT NULL,
  `pago` decimal(9,2) NOT NULL,
  `obs` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;






CREATE TABLE `manda_email` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(30) NOT NULL,
  `email` varchar(30) NOT NULL,
  `cel` varchar(30) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `productos` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(30) NOT NULL,
  `descripcion` varchar(30) NOT NULL,
  `precio` decimal(7,0) NOT NULL,
  `stock` int(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `recibo` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `numero` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `semanas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `movil` int(4) NOT NULL,
  `x_semana` decimal(9,2) NOT NULL,
  `total` decimal(9,2) NOT NULL,
  `activo` varchar(2) NOT NULL,
  `fecha` date NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `movil` (`movil`)
) ENGINE=InnoDB AUTO_INCREMENT=755 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `users` (
  `id_users` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL,
  `PASSWORD` char(32) NOT NULL,
  `email` varchar(100) NOT NULL,
  `permiso` varchar(15) NOT NULL,
  `uname` varchar(20) NOT NULL,
  `initial_date` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id_users`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `users_logeado` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL,
  `fecha` date NOT NULL,
  `abre` varchar(10) NOT NULL,
  `cierra` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `vauchin` (
  `id` int(50) NOT NULL AUTO_INCREMENT,
  `movil` int(4) NOT NULL,
  `viaje` int(10) NOT NULL,
  `total` int(9) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;






CREATE TABLE `voucher_nuevos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_vou` int(4) NOT NULL,
  `viaje_no` int(10) DEFAULT NULL,
  `origen` varchar(255) CHARACTER SET utf8mb4 NOT NULL,
  `estado` varchar(50) CHARACTER SET utf8mb4 NOT NULL,
  `nom_pasaj` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `tel_pasaj` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `movil` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `chof` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `dni` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `marca` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `patente` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `c_costo` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `cc` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `c_corr` varchar(25) CHARACTER SET utf8mb4 NOT NULL,
  `c_cont` int(8) NOT NULL,
  `traslado` int(10) NOT NULL,
  `siniestro` int(10) NOT NULL,
  `solicitado` varchar(10) CHARACTER SET utf8mb4 NOT NULL,
  `completado` varchar(10) NOT NULL,
  `destino` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `reloj` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `peaje` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `equipaje` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `adicional` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `plus` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `total` varchar(9) CHARACTER SET utf8mb4 NOT NULL,
  `operador` varchar(30) CHARACTER SET utf8 NOT NULL,
  `autorizante` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `obs_chof` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `obs_pas` varchar(30) CHARACTER SET utf8mb4 NOT NULL,
  `created_at` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=latin1;






CREATE TABLE `voucher_temporales` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `movil` varchar(6) NOT NULL,
  `fecha` varchar(10) NOT NULL,
  `viaje_no` int(7) NOT NULL,
  `cc` int(4) NOT NULL,
  `reloj` decimal(12,2) NOT NULL,
  `peaje` decimal(12,2) NOT NULL,
  `equipaje` decimal(12,2) NOT NULL,
  `adicional` decimal(12,2) NOT NULL,
  `plus` decimal(12,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `voucher_validado` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `movil` varchar(6) NOT NULL,
  `fecha` varchar(10) NOT NULL,
  `viaje_no` int(7) NOT NULL,
  `cc` int(4) NOT NULL,
  `reloj` decimal(12,2) NOT NULL,
  `peaje` decimal(12,2) NOT NULL,
  `equipaje` decimal(12,2) NOT NULL,
  `adicional` decimal(12,2) NOT NULL,
  `plus` decimal(12,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;






